import React, {Component} from "react";
import BookCard from "./BookCard";
import books from "./db";

export default class BookCards extends Component {
    render() {
        console.log(books[0].books);
        return (
            <BookCard bookCard = {books[0].books}>
            </BookCard>
        );
    }

}
